css:
.advanced-open-file {
  display: flex;
  flex-direction: column;
}
.advanced-open-file .icon-file-add,
.advanced-open-file .icon-file-directory-create {
  padding-left: 10px;
}
.advanced-open-file .info-message {
  flex: 0 0 1.5em;
  margin-bottom: 0.75em;
}
.advanced-open-file atom-text-editor {
  flex: 0 0 2.3em;
}
.advanced-open-file .list-group {
  overflow: auto;
  flex: 2;
  position: relative;
}
.advanced-open-file .list-item {
  padding: 0 10px;
}
.advanced-open-file .list-item .add-project-folder {
  float: right;
  color: #777777;
}
.advanced-open-file .list-item .add-project-folder:hover {
  color: #111111;
  cursor: pointer;
}
.advanced-open-file .list-item .add-project-folder::before {
  width: auto;
  margin-right: 0;
}
.advanced-open-file .list-item .filename {
  margin: 0;
}
.advanced-open-file .list-item .selected {
  background: rgba(255, 255, 255, 0.1);
}
.advanced-open-file .list-item:hover {
  background: rgba(255, 255, 255, 0.1);
}
